import React from 'react';
import Card from './Card';

const Column = ({ title, cards }) => {
  return (
    <div className="column">
      <h2>{title}</h2>
      {cards.map(card => (
        <Card key={card.id} {...card} />
      ))}
    </div>
  );
};

export default Column;
